Listen up peeps! To mark the start of #16daysofactivism on violence against women and girls, @TheCircleNGO has released this hugely powerful short film, #SheCameToMe. Directed by Saffron Burrows the film features BAFTA-award winning actress Marianne Jean-Baptiste, reciting the words of Nozuko Conjwa, a counsellor in South Africa working every day with the survivors of rape and domestic abuse. 

TW: Her words are hard to hear but please listen, please watch and please share this film.

You can also support The Circle’s work around the world, from providing urgently needed help to
women and girls who have suffered abuse and violence by donating. Just text 16DAYS to 70460 to give £16 (in the UK) or by visiting the website which can accept donations from anywhere in the world.

Your donations will help women like Nozuko continue their work providing immediate support and contribute to bringing about the long-term changes needed to enable women and girls to break free and move on from violence and fear.

